function createTable(para) {
  for (let i = 0; i < para.length; i++) {
    alert(para[i].title);
    if (para[i].title == "NavBar")
    {
      alert("Yes!")
    }
  }
}

function asdqwe(){ 
  return data.map((para) => <a> { para.ideas.map((asd) => asd.title) }) } </a>) 
}


  function loops(){ 
    //asdqwe()

    let children = [];

    for (let i = 0; i < 3; i++)
    {
      children.push(data.ideas[i].title);
    }

    return data.map((para) => <a> {para.ideas[3].title } </a>) 
  }

class App extends Component {

  render() {

    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <div>{loops()}</div>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
